INSERT INTO `example_app_post` VALUES (1,'Centroid based Text summarization in Python','Centroid-based-Text-summarization-in-Python','<h3 style=\"text-align: justify; margin: 2ex 0px 1ex; font-size: 13.44px; font-family: Verdana, Arial, Helvetica, sans-serif;\"><b style=\"\">Introduction</b></h3><p style=\"font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13.44px;\"><span style=\"font-size: large; font-family: &quot;times new roman&quot;, times;\">It is an Extractive summarization, which extracts important words from document(s) to form a summary. Centroid-based summarization works as identifying the most central sentences in multiple documents that give the necessary and sufficient amount of information related to the main theme of document(s). A common way of identifying the central sentences is to represent the sentences in vector space.</span></p><p style=\"font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13.44px;\"><span style=\"font-size: large; font-family: &quot;times new roman&quot;, times;\">Centrality of sentence is always defined in terms of centrality of word.&nbsp;<a href=\"http://www.tfidf.com/\" style=\"color: rgb(102, 102, 102);\">TF X IDF scores&nbsp;</a>are used to measure the centrality of words. Here, words that have TF X IDF scores above a predefined cosine threshold are centroid of cluster.</span></p><p style=\"font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13.44px;\"><span style=\"font-size: large; font-family: &quot;times new roman&quot;, times;\">In centroid based summarization, the sentences which have more words from centroid of cluster are considered as central sentences. Finally, those sentences are produced as summary of multiple documents.</span></p><p style=\"font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13.44px;\"><span style=\"font-size: large; font-family: &quot;times new roman&quot;, times;\">Centroid based summarization is introduced by Radev, Blair-Goldensohn, and Zhang.</span></p><h3 style=\"margin: 2ex 0px 1ex; font-size: 13.44px; font-family: Verdana, Arial, Helvetica, sans-serif;\"><span style=\"font-weight: bold;\">Implementation of Text Summarization in Python</span></h3><h3 style=\"margin: 2ex 0px 1ex; font-size: 13.44px; font-family: Verdana, Arial, Helvetica, sans-serif;\"><br></h3><pre class=\"code\" style=\"overflow: hidden; color: rgb(0, 0, 0); background-color: rgb(255, 255, 255);\">\r\n <script async src=\"https://pagead2.googlesyndication.com/pagead/js/adsbygoogle.js\"></script>\r\n					<ins class=\"adsbygoogle\"\r\n     						style=\"display:block; text-align:center;\"\r\n     						data-ad-layout=\"in-article\"\r\n     						data-ad-format=\"fluid\"\r\n     						data-ad-client=\"ca-pub-5181933327362047\"\r\n    		 				data-ad-slot=\"2832571695\">\r\n    		 			</ins>\r\n					<script>\r\n     						(adsbygoogle = window.adsbygoogle || []).push({});\r\n					</script>\r\n	    \r\n<code>\r\nfrom os import listdir\r\nimport string\r\nimport math\r\n\r\n\"\"\"Method to calculate Inverse Document Frequency Score\"\"\"\r\ndef calculate_idf(word):\r\n    files = [f for f in listdir(\"E:\\Works\\Products\\doc\") ]  #Specify the directory where the documents located\r\n    count,wcount=2,1    \r\n    for file1 in files:\r\n        file=open(\"E:\\Works\\Products\\doc\\\\\" +file1,\'r\')     #Specify the directory where the documents located\r\n        page=file.read()\r\n        if(word in page):\r\n            wcount+=1\r\n        count+=1\r\n    idf=count/wcount\r\n    \r\n    return math.log(idf,10)\r\n\r\n\"\"\"Method to calculate Centroid Score of sentences\"\"\"\r\ndef calculate_centroid(sentences):\r\n    \r\n    \"\"\"\"Compute tf X idf score for each word\"\"\"\r\n    tfidf=dict()\r\n    for sentence in sentences:\r\n        words=sentence.split()\r\n        for word in words:\r\n            if word in tfidf:\r\n                tfidf[word]+=calculate_idf(word)\r\n            else:\r\n                tfidf[word]=calculate_idf(word)\r\n\r\n    \"\"\"Construct the centroid of Cluster\r\n    By taking the words that are above the threshold\"\"\"\r\n\r\n    centroid=dict()\r\n    threshold=0.7\r\n    for word in tfidf:\r\n        if(tfidf[word]&gt;threshold):\r\n            centroid[word]=tfidf[word]\r\n        else:\r\n            centroid[word]=0\r\n\r\n    \"\"\"Compute the Score for Sentences\"\"\"\r\n    senctence_score=list()\r\n    counter=0\r\n    for sentence in sentences:\r\n        senctence_score.append(0)\r\n        words=sentence.split()\r\n        for word in words:\r\n            senctence_score[counter]+=centroid[word]\r\n        \r\n        counter=counter+1\r\n    return senctence_score\r\n\r\n\r\n\"\"\"Splitting Documents as sentences\"\"\"\r\nfiles = [f for f in listdir(\"E:\\Works\\Products\\doc\") ]\r\npage=\"\"\r\nfor file1 in files:\r\n    file=open(\"E:\\Works\\Products\\doc\\\\\" +file1,\'r\')\r\n    page+=file.read()\r\n    file.close()\r\nsentences=page.split(\".\")\r\nsenctence_score=calculate_centroid(sentences)\r\n    \r\n\r\n\"\"\"Printing Sentences which has more central words\"\"\"\r\nfor i in range(len(sentences)):\r\n    if(senctence_score[i]&gt;15):\r\n        print(sentences[i])\r\n</code>\r\n</pre>\r\n <script async src=\"https://pagead2.googlesyndication.com/pagead/js/adsbygoogle.js\"></script>\r\n					<ins class=\"adsbygoogle\"\r\n     						style=\"display:block; text-align:center;\"\r\n     						data-ad-layout=\"in-article\"\r\n     						data-ad-format=\"fluid\"\r\n     						data-ad-client=\"ca-pub-5181933327362047\"\r\n    		 				data-ad-slot=\"2832571695\">\r\n    		 			</ins>\r\n					<script>\r\n     						(adsbygoogle = window.adsbygoogle || []).push({});\r\n					</script>\r\n	    \r\n<h3 style=\"margin: 2ex 0px 1ex; font-size: 13.44px; font-family: Verdana, Arial, Helvetica, sans-serif;\"><span style=\"font-weight: bold;\">Implementation Details</span></h3><p style=\"font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13.44px;\"><span style=\"font-size: large; font-family: &quot;times new roman&quot;, times;\">I have implemented the Centroid based text summarization in python, the above-mentioned code is purely for the text summarization which contains method for calculating IDF score of every word and centroid score of every sentence. To understand Python basics refer&nbsp;<a href=\"http://www.decodeschool.com/Python-Programming/Examples\" style=\"color: rgb(102, 102, 102);\">Python Programming Examples</a></span></p><p style=\"font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13.44px;\"><span style=\"font-size: large; font-family: &quot;times new roman&quot;, times;\">Centroid score of every sentence is calculated by TF X IDF score of words in the sentence. To easily understand the algorithm of centroid based text summarization, preprocessing techniques like&nbsp;<a href=\"https://www.geeksforgeeks.org/removing-stop-words-nltk-python/\" style=\"color: rgb(102, 102, 102);\">stop word removal</a>&nbsp;and stemming are not given in the above implementation</span></p>','2020-06-02 14:29:19.232093',1,'banner_python_s0ggHuB.jpg'),(2,'Input and Output in Python','input-and-output-in-python','<p></p><h2 style=\"text-align: justify; \">Input and Output in Python - Part I (Output and Formatting)</h2>\r\n\r\n<p style=\"text-align: justify;\">Programming learning is not about learning a programming language\'s syntax. If you thoroughly read any materials, such as books or tutorials, then programming is not meant to be learned. Programming is all about constructing logic, syntax only plays a 5 percent role.</p>\r\n\r\n<p style=\"text-align: justify;\">If you are good in the building of logic then in just a few days you can learn any programming language. My posts will concentrate on both constructing logic and mapping the syntax to the logic created.</p><p>\r\n\r\n</p><p style=\"text-align: justify;\">Programming is a series of statements written to perform any function on a computer, two essential operations in any function are called input and output display. Typically we learn programming with a console application which is an application based on text. In console application inputs get from keyboard and outputs displayed to the monitor. The figure below indicates Console Use.</p><p style=\"text-align: justify;\"><img src=\"/media/django-summernote/2020-06-02/0a8ba478-b0e4-4d09-9c84-51b8d257c7e3.jpg\" style=\"width: 100%;\"><br></p>\r\n\r\n               \r\n<p style=\"text-align: justify;\">Inputs and outputs are available in different formats such as series, numbers, whole numbers and decimal numbers etc. In this review, we dive deep into the dynamics of Input and Output Statements.</p>\r\n\r\n\r\n<h3 style=\"text-align: justify;\">Example 1: Printing the \"Hello World\"</h3>\r\n\r\n<pre><div style=\"text-align: justify;\"><span style=\"white-space: pre-wrap;\"><br></span></div><code><div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">print(\"Hello world\")</span></div></code><div style=\"text-align: justify;\"></div></pre>\r\n\r\n<p style=\"text-align: justify;\"><img src=\"/media/django-summernote/2020-06-02/828cc5ea-88a8-468c-ac13-a725b52f77d8.jpg\" style=\"width: 100%;\"><br></p><p style=\"text-align: justify;\">The above statement or command shows the \"Hello World\" string in the console. Yeah, printing is the function statement used to display something in the console.</p>\r\n\r\n<h3 style=\"text-align: justify;\">Example 2 : Simple Input and Output</h3>\r\n\r\n<p style=\"text-align: justify;\">When you want a string to be entered by the user and the machine to display the same.</p>\r\n\r\n<pre><div style=\"text-align: justify;\"><span style=\"white-space: pre-wrap;\"><br></span></div><code><div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">text = input(\"Enter your Name:\") </span></div><div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">  </span></div><div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">print(text)</span></div></code><div style=\"text-align: justify;\"></div></pre>\r\n\r\n\r\n<p style=\"text-align: justify;\"><img src=\"/media/django-summernote/2020-06-02/d7b68cef-620b-4e25-9ad9-45681643a95c.jpg\" style=\"width: 100%;\"><br></p><p style=\"text-align: justify;\">The first line shows the \"Enter Your Name\" message and reads the user\'s input and saves the memory, the location of the memory being referenced by the name (variable) named text.  The second statement prints the string referenced by the name text.</p>\r\n\r\n<p style=\"text-align: justify;\">You will remember that in Example 1, Hello World is prefixed and suffixed with double quotes inside the print statement, but in Example 2 text is not protected by double quotes, since we want to print content inside text and not text.</p>\r\n\r\n<p style=\"text-align: justify;\">Yeah, in this learning process we concentrate intensely on output statements and subsequent input statements for a few miles.</p><p>\r\n\r\n\r\n</p><h3 style=\"text-align: justify;\">print Statement:</h3>\r\n\r\n<p style=\"text-align: justify;\">How to print a varible value with additional pharase, such as \"Entered Name is:\"? We can do that in many ways.</p>\r\n\r\n<h3 style=\"text-align: justify;\">Example 3:</h3>\r\n\r\n<p style=\"text-align: justify;\">First option is we can use string concatenation like:</p>\r\n\r\n<pre><div style=\"text-align: justify;\"><span style=\"white-space: pre-wrap;\"><br></span></div><code><div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">name = input(\"Enter your Name:\")</span></div><div style=\"text-align: justify;\"></div><div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">print(\"Entered Name is: \" + name)</span></div></code><div style=\"text-align: justify;\"></div></pre>\r\n<p>           \r\n\r\n</p><p style=\"text-align: justify;\"><img src=\"/media/django-summernote/2020-06-02/622a3f7a-46fd-4eb3-ae66-f000d8f3ef47.jpg\" style=\"width: 100%;\"><br></p><p style=\"text-align: justify;\">This approach generates an exception if the variable has numbers (integer or float)\r\n</p>\r\n\r\n <script async src=\"https://pagead2.googlesyndication.com/pagead/js/adsbygoogle.js\"></script>\r\n					<ins class=\"adsbygoogle\"\r\n     						style=\"display:block; text-align:center;\"\r\n     						data-ad-layout=\"in-article\"\r\n     						data-ad-format=\"fluid\"\r\n     						data-ad-client=\"ca-pub-5181933327362047\"\r\n    		 				data-ad-slot=\"2832571695\">\r\n    		 			</ins>\r\n					<script>\r\n     						(adsbygoogle = window.adsbygoogle || []).push({});\r\n					</script>\r\n	    \r\n<h3 style=\"text-align: justify;\">\r\nExample 4:\r\n</h3>\r\n<p style=\"text-align: justify;\">\r\nsecond option is you can pass the pharase and varible as two arguments to print funtion\r\n</p>\r\n<pre><div style=\"text-align: justify;\"><span style=\"white-space: pre-wrap;\"><br></span></div><code><div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">name = input(\"Enter your Name:\")</span></div><div style=\"text-align: justify;\"></div><div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">print(\"Entered Name is: \", name)</span></div><div style=\"text-align: justify;\"></div>\r\n<div style=\"text-align: justify;\"><span style=\"white-space: pre;\"><br></span></div></code></pre>\r\n                \r\n \r\n<p style=\"text-align: justify;\">\r\nHowever, formatted print is suitable to print outputs in different formats.\r\n</p>\r\n \r\n\r\n<h3 style=\"text-align: justify;\">Formatted print statement</h3>\r\n\r\n<h3 style=\"text-align: justify;\">Example 5:</h3>\r\n<pre><div style=\"text-align: justify;\"><span style=\"white-space: pre-wrap;\"><br></span></div><code><div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">name = input(\"Enter your Name:\")</span></div><div style=\"text-align: justify;\"></div><div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">print(\"Entered Name is: {} \".format(name))</span></div>\r\n<div style=\"text-align: justify;\"><span style=\"white-space: pre;\"><br></span></div></code></pre>\r\n\r\n \r\n<p style=\"text-align: justify;\">\r\nThe above example shows the basic formatting, and the following examples show different formatted printing scopes.\r\n</p>\r\n<h3 style=\"text-align: justify;\">\r\nExample 6:\r\n</h3>\r\n<pre><div style=\"text-align: justify;\"><span style=\"white-space: pre-wrap;\"><br></span></div><code><div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">fname = input(\"Enter First Name:\") </span></div><div style=\"text-align: justify;\"></div><div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">lname = input(\"Enter Second Name:\")</span></div><div style=\"text-align: justify;\"></div><div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">print(\"First Name: {} \\nLast Name: {}\".format(fname,lname))</span></div></code><div style=\"text-align: justify;\"></div></pre>\r\n\r\n\r\n \r\n\r\n<p style=\"text-align: justify;\"><img src=\"/media/django-summernote/2020-06-02/afe1d884-c1b8-427a-a277-5358dd61d17b.jpg\" style=\"width: 100%;\"><br></p><p style=\"text-align: justify;\">two {} (set brackets) are reserved for the value of variables fname and lname.\r\n</p><p style=\"text-align: justify;\">\r\n\\n prints the new line in the console. using this format function, we could do right and center alignment the text in the specified length\r\n</p>\r\n<p style=\"text-align: justify;\">\r\nLike \\n there are several other escape sequences, the follwing table illustrates the same.\r\n</p>\r\n<h3 style=\"text-align: justify;\">\r\nExample 7:</h3>\r\n<pre><div style=\"text-align: justify;\"><span style=\"white-space: pre-wrap;\"><br></span></div><code><div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">print(\"Hello\\tRamesh\")                 #             \\t leaves a tab space </span></div><div style=\"text-align: justify;\"></div>\r\n<div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">print(\"Hello \\\' Ramesh\")                #             \\\' prints single quotes( \' )</span></div><div style=\"text-align: justify;\"></div>\r\n<div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">print(\"Hello \\\" Ramesh\")                #             \\\" prints double quotes( \" )</span></div><div style=\"text-align: justify;\"></div>\r\n<div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">print(\"Hello \\\\ Ramesh\")                #             \\\\ prints backslash ( \\ )</span></div><div style=\"text-align: justify;\"></div>\r\n<div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">print(\"Hello\\bRamesh\")                  #             \\b backspace (it deletes \'o\') </span></div><div style=\"text-align: justify;\"></div>\r\n<div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">print(\"Hello and welcome\\rRamesh\")      #             \\r carriage return, cursor moves to   </span></div><div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">                                                                                                                       starting position of line</span></div>\r\nprint(\"Hello\\vRamesh\")  		#             \\v Vertical Space\r\n<div style=\"text-align: justify;\"><span style=\"white-space: pre;\"><br></span></div></code></pre><div style=\"text-align: justify;\">Note : # denotes comments, comments doesn\'t execute by the computer</div><p></p><p>\r\n\r\n</p><h3>\r\n</h3><h3 style=\"text-align: justify;\"><img src=\"/media/django-summernote/2020-06-02/51ef1ee0-54d3-4c4a-8509-d10c736500bb.jpg\" style=\"width: 100%;\"><br></h3><h3 style=\"text-align: justify;\">Example 8:</h3>\r\n<pre><div style=\"text-align: justify;\"><span style=\"white-space: pre-wrap;\"><br></span></div><code><div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">print(\"{:&gt;10}\".format(\"Ramesh\"))             #Right Alignment </span></div><div style=\"text-align: justify;\"></div>\r\n<div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">print(\"{:^10}\".format(\"Ramesh\"))             #Center Alignment</span></div><div style=\"text-align: justify;\"></div>\r\n<div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">print(\"{:10}\".format(\"Ramesh\"))               #left Alignment</span></div><div style=\"text-align: justify;\"></div>\r\n<div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">print(\'{:_&lt;10}\'.format(\'Ramesh\'))             #left alignment and fill</span></div><div style=\"text-align: justify;\"></div>\r\n<div style=\"text-align: justify;\"><span style=\"white-space: pre;\"><br></span></div></code></pre>\r\n\r\n <script async src=\"https://pagead2.googlesyndication.com/pagead/js/adsbygoogle.js\"></script>\r\n					<ins class=\"adsbygoogle\"\r\n     						style=\"display:block; text-align:center;\"\r\n     						data-ad-layout=\"in-article\"\r\n     						data-ad-format=\"fluid\"\r\n     						data-ad-client=\"ca-pub-5181933327362047\"\r\n    		 				data-ad-slot=\"2832571695\">\r\n    		 			</ins>\r\n					<script>\r\n     						(adsbygoogle = window.adsbygoogle || []).push({});\r\n					</script>\r\n	     \r\n<h3>\r\n</h3><h3 style=\"text-align: justify;\"><img src=\"/media/django-summernote/2020-06-02/52ef4073-e7d1-4c44-9e23-c9915f5a4a84.jpg\" style=\"width: 100%;\"><br></h3><h3 style=\"text-align: justify;\">Truncate using format()</h3>\r\n<h3 style=\"text-align: justify;\">\r\nExample 9:\r\n</h3><p>\r\n</p><p style=\"text-align: justify;\">we can truncate string using .\r\n</p>\r\n<pre><div style=\"text-align: justify;\"><span style=\"white-space: pre-wrap;\"><br></span></div><code><div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">print(\'{:.10}\'.format(\'Hello Everyone\'))</span></div></code><div style=\"text-align: justify;\"></div></pre>\r\n<p>\r\n</p><p style=\"text-align: justify;\"><img src=\"/media/django-summernote/2020-06-02/a64c2020-d460-42ae-ad1e-9929b163e9aa.jpg\" style=\"width: 100%;\"><br></p><p style=\"text-align: justify;\">First 10 characters will be printed in the large string.\r\n</p>\r\n<p style=\"text-align: justify;\"> \r\nFew more applications using String Formatting in Print\r\n</p>\r\n<h3 style=\"text-align: justify;\">\r\nExample 10:</h3>\r\n<pre><div style=\"text-align: justify;\"><span style=\"white-space: pre-wrap;\"><br></span></div><code>\r\n<div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">print(\"1 X 9 = {:&gt;2}\".format(\'5\'))</span></div><div style=\"text-align: justify;\"></div><div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">print(\"2 X 9 = {:&gt;2}\".format(\'10\'))</span></div><div style=\"text-align: justify;\"></div><div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">print(\"3 X 9 = {:&gt;2}\".format(\'15\'))</span></div><div style=\"text-align: justify;\"></div><div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">print(\"4 X 9 = {:&gt;2}\".format(\'20\'))</span></div><div style=\"text-align: justify;\"></div><div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">print(\"5 X 9 = {:&gt;2}\".format(\'25\'))</span></div><div style=\"text-align: justify;\"></div></code><div style=\"text-align: justify;\"></div></pre>\r\n<p style=\"text-align: justify;\"><img src=\"/media/django-summernote/2020-06-02/715eebba-b98d-46fa-b7cc-72669e6fe3f1.jpg\" style=\"width: 100%;\"><br></p><p style=\"text-align: justify;\">Print Multiplication table in with Alignment</p>\r\n<p style=\"text-align: justify;\">\r\nyou can see that answers in the table are right aligned by format() method.</p>\r\n\r\n<h3 style=\"text-align: justify;\">Example 11:</h3>\r\n<h3 style=\"text-align: justify;\">\r\nBilling Information</h3>\r\n<pre><div style=\"text-align: justify;\"><span style=\"white-space: pre-wrap;\"><br></span></div><code><div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">print(\"{:20} {:^5} {:&gt;5} {:&gt;6}\".format(\'Product\', \'Price\', \'Qty\', \'Amount\' ))</span></div><div style=\"text-align: justify;\"></div>\r\n<div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">print(\"{:20} {:&gt;5} {:&gt;5} {:&gt;6}\".format(\'Hard Disk\', \'200\', \'1\', \'200\' ))</span></div><div style=\"text-align: justify;\"></div>\r\n<div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">print(\"{:20} {:&gt;5} {:&gt;5} {:&gt;6}\".format(\'Keyboard\', \'150\',\'10\', \'1500\' ))</span></div><div style=\"text-align: justify;\"></div>\r\n<div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">print(\"{:20} {:&gt;5} {:&gt;5} {:&gt;6}\".format(\'Mouse\',\'100\', \'2\', \'200\' ))</span></div><div style=\"text-align: justify;\"></div>\r\n<div style=\"text-align: justify;\"><span style=\"background-color: transparent; color: inherit; font-size: inherit;\">print(\"{:20} {:&gt;5} {:&gt;5} {:&gt;6}\".format(\'Total\', \'\',\'\', \'1900\' ))</span></div></code><div style=\"text-align: justify;\"></div></pre>\r\n\r\n<p>\r\n\r\n</p><p style=\"text-align: justify;\"><img src=\"/media/django-summernote/2020-06-02/c7f2c4d6-e9eb-4d1e-b2ee-7600147e0390.jpg\" style=\"width: 100%;\"><br></p><p style=\"text-align: justify;\">Here also, Products are properly left aligned and others are right aligned.\r\n</p><p style=\"text-align: justify;\">\r\nWe have learned string output formatting in this article, and we will learn the formatting of numbers and input formatting in coming posts.</p><p></p>','2020-06-02 14:38:01.442962',2,'banner_python_6VD1vkz.jpg'),(3,'OOPS CASE STUDY 1','oops-case-study-1','<div align=\"center\">\r\n\r\n<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"border: none;\">\r\n <tbody><tr>\r\n  <td width=\"141\" valign=\"top\" style=\"width:106.1pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0in 5.4pt 0in 5.4pt\">\r\n  <p class=\"MsoNormal\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\n  font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Faculty Name<o:p></o:p></span></p>\r\n  </td>\r\n  <td width=\"460\" v