lign:justify\"><b>Question:</b></p><p class=\"MsoNormal\" style=\"text-align:justify\">1. Will all the three complete\r\ntheir work at last?</p><p class=\"MsoNormal\" style=\"text-align:justify\">\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"text-align:justify\">2. How you Can identify the\r\nanswer for Question 1?</p><p class=\"MsoNormal\" style=\"text-align:justify\">Solution: </p><p class=\"MsoNormal\" style=\"text-align:justify\"><b>Keys:</b></p><p class=\"MsoListParagraph\" style=\"text-align:justify;text-indent:-.25in;\r\nmso-list:l0 level1 lfo1\"><!--[if !supportLists]-->1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp; &nbsp; &nbsp;&nbsp;<span style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; text-indent: 0px;\">1.</span>&nbsp;</span><!--[endif]-->Yes\r\nthey will complete their work.</p><p class=\"MsoNormal\" style=\"text-align:justify\">\r\n\r\n\r\n\r\n\r\n\r\n<span style=\"font-size:11.0pt;mso-bidi-font-size:10.0pt;line-height:115%;\r\nfont-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:\r\nCalibri;mso-fareast-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi;\r\nmso-ansi-language:EN-US;mso-fareast-language:EN-US;mso-bidi-language:HI\"><span style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">2.&nbsp;</span>Using\r\nResource Allocation Graph. (IF RAG forms Cycle then there is a dead lock\r\noccurred)</span><br></p>','2022-07-28 12:31:28.000000',6,'logo_ac773e45b008d6616aadbc1a30507760_1x_CQ6UO9Q.png'),(9,'Scheduling Algorithm case Study','scheduling-algorithm-case-study','<p class=\"MsoNormal\" style=\"line-height:150%\"><b><u><span style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Problem\r\nStatement:<o:p></o:p></span></u></b></p><p>\r\n\r\n</p><p class=\"MsoNormal\" style=\"line-height:150%\"><span style=\"font-size:12.0pt;\r\nline-height:150%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">In a hospital Dr. Ravi has\r\nto attend both emergency patients and non emergency out patients. If there is\r\nany one emergency patient he is not suppose to attend out patients. Dr. Ravi\r\nshould also permit Medical representatives to meet him if there are no patients\r\nwaiting for him.</span></p><p class=\"MsoNormal\" style=\"line-height:150%\"><span style=\"font-size:12.0pt;\r\nline-height:150%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">&nbsp;<o:p></o:p></span><b><u><span style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Questions:</span></u></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent:-.25in;line-height:150%;\r\nmso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-size:12.0pt;\r\nline-height:150%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\"font-size:12.0pt;line-height:150%;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Suggest a right schedule for Dr. Ravi.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-.25in;line-height:150%;\r\nmso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-size:12.0pt;\r\nline-height:150%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\"font-size:12.0pt;line-height:150%;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Consider there are 2 emergency patients\r\n( first Patient Sick with Severe Viral Fever and<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"line-height:150%\"><span style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Second\r\none met accident) and few out patients.&nbsp;\r\nHow your scheduling algorithm schedules patients to Dr. Ravi.</span></p><p class=\"MsoNormal\" style=\"line-height:150%\"><b><u><span style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Solution:\r\n<o:p></o:p></span></u></b></p><p class=\"MsoListParagraphCxSpLast\" style=\"line-height:150%\">\r\n\r\n</p><p class=\"MsoListParagraph\" style=\"text-indent:-.25in;line-height:150%;\r\nmso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-size:12.0pt;\r\nline-height:150%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style=\"font-size:12.0pt;line-height:150%;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">The most suitable scheduling algorithm\r\nfor the above problem is <b>Multi Level\r\nQueue Scheduling</b>. Each Level of queue can use Different Scheduling\r\nalgorithms.</span></p><p class=\"MsoListParagraph\" style=\"text-indent:-.25in;line-height:150%;\r\nmso-list:l0 level1 lfo1\"><img src=\"/media/django-summernote/2022-07-28/9d1892db-9922-47b2-a2c2-a6d11fba7367.png\" style=\"width: 634px;\"><span style=\"font-size:12.0pt;line-height:150%;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><br></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent:-.25in;line-height:150%;\r\nmso-list:l0 level1 lfo1;tab-stops:66.0pt\"><!--[if !supportLists]--><span style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp; &nbsp; <span style=\"font-size: 12pt;\">&nbsp; 2</span></span></span><span style=\"font-size: 12pt;\"></span><!--[endif]--><span style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">&nbsp;i. Emergency Patients have highest priority\r\nand out patients have Low Priority. <o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"line-height:150%;tab-stops:30.15pt 66.0pt\"><span style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">&nbsp; &nbsp; ii.\r\nDr. Ravi attends accident patient first then he attends Viral fever patients,\r\nsince &nbsp;&nbsp;Highest priority&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; </span><span style=\"font-family: &quot;Times New Roman&quot;, &quot;serif&quot;; font-size: 12pt;\">Queue Using\r\nPriority based scheduling algorithm.</span></p><p class=\"MsoListParagraph\" style=\"text-indent:-.25in;line-height:150%;\r\nmso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;line-height:150%;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">\r\n\r\n\r\n\r\n</span></p><p class=\"MsoListParagraphCxSpLast\" style=\"line-height:150%;tab-stops:66.0pt\"><span style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">&nbsp; &nbsp; iii.\r\nAfter Attending Emergency patients Dr. Ravi attends out patients by first Come\r\nfirst serve method.<o:p></o:p></span></p><p class=\"MsoListParagraph\" style=\"text-indent:-.25in;line-height:150%;\r\nmso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;line-height:150%;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><o:p><br></o:p></span></p>','2022-07-28 12:34:28.000000',6,'logo_ac773e45b008d6616aadbc1a30507760_1x_j0yDLRb.png'),(10,'Semaphore for Process Synchornization','semaphore-for-process-synchornization','<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><b><u><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Problem Statement:<o:p></o:p></span></u></b></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">A\r\nfactory has few machines which are used for manufacturing sheet metal products.\r\nOperator, Cleaner and mechanic are the 3 users who access those machines.\r\nOperator runs the machine to produce sheet metal products; mechanic trouble\r\nshoots the machine or performs daily maintenance work on machine. Cleaner\r\ncleans the machine and fills lubrication oil on machine.<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">&nbsp;Any user is restricted to do their work on the\r\nmachine when another user doing their work on the same machine. For example\r\nOperator should not run the machine while either mechanic trouble shooting the\r\nmachine or cleaner cleaning the machine.</span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><b><u><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Questions :<o:p></o:p></span></u></b></p><p class=\"MsoListParagraphCxSpFirst\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">How\r\nyou synchronize the users of machine? <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\">\r\n\r\n\r\n\r\n</p><p class=\"MsoListParagraphCxSpLast\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Design\r\nan algorithm for the Synchronization Problem.</span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><b><u><span style=\"font-size:12.0pt;\r\nline-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Solution:<o:p></o:p></span></u></b></p><p class=\"MsoListParagraphCxSpFirst\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Semaphore\r\ninteger variable <b>Machine_free</b> is\r\nused to solve the synchronization problem.<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align:justify;text-justify:\r\ninter-ideograph;text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">If\r\n<b>Machine_free</b> value is equal to 1\r\nthen Machine is not used by any user, so requested user can access the machine\r\nfor their work.<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpLast\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:-.25in;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">\r\n\r\n\r\n\r\n\r\n\r\n</span></p><p class=\"MsoListParagraphCxSpLast\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">If\r\nits value is less than 1 then some user working on machine so another requested\r\nuser should wait.</span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Class\r\nmachine_synchornize;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">{<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">&nbsp;Private int Machine_free;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">&nbsp;Public void machine_synchornize()<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">&nbsp;{<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">&nbsp; Machine_free = 1;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">&nbsp; }</span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\">&nbsp; &nbsp;Public void wait()</p><p class=\"MsoNormal\">&nbsp; {</p><p class=\"MsoNormal\">&nbsp; &nbsp;While(this.machine_free\r\n&lt;=0);</p><p class=\"MsoNormal\">&nbsp; &nbsp; Machine_free--;</p><p class=\"MsoNormal\">&nbsp; &nbsp;}</p><p class=\"MsoNormal\"><o:p>&nbsp; &nbsp;</o:p>Public void Signal()</p><p class=\"MsoNormal\">&nbsp; &nbsp;{</p><p class=\"MsoNormal\">&nbsp; &nbsp; Machine_free++;</p><p class=\"MsoNormal\">&nbsp; &nbsp; }</p><p class=\"MsoNormal\"><o:p>&nbsp; &nbsp;&nbsp;</o:p>Class user</p><p class=\"MsoNormal\">&nbsp; &nbsp; {</p><p class=\"MsoNormal\"><span style=\"text-indent: 0.5in;\">&nbsp; &nbsp; Void Dowork()</span></p><p class=\"MsoNormal\"><span style=\"text-indent: 0.5in;\">&nbsp; &nbsp; {</span></p><p class=\"MsoNormal\"><span style=\"text-indent: 0.5in;\">&nbsp; &nbsp; Machine_synchornize\r\nM1 = new machine_synchornize();</span></p><p class=\"MsoNormal\"><span style=\"text-indent: 0.5in;\">&nbsp; &nbsp; M1.wait();</span></p><p class=\"MsoNormal\"><span style=\"text-indent: 0.5in;\">&nbsp; &nbsp; //Access\r\nMachine;</span></p><p class=\"MsoNormal\"><span style=\"text-indent: 0.5in;\">&nbsp; &nbsp; M1.signal();</span></p><p class=\"MsoNormal\"><span style=\"text-indent: 0.5in;\">&nbsp; &nbsp; }</span></p><p class=\"MsoListParagraphCxSpLast\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:-.25in;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</span></p><p class=\"MsoNormal\">&nbsp; &nbsp; }</p><p class=\"MsoListParagraphCxSpLast\" style=\"text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:-.25in;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\"><o:p><br></o:p></span></p>','2022-07-28 12:38:27.000000',6,'logo_ac773e45b008d6616aadbc1a30507760_1x_JHxBRDT.png');
